var listaSeries = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRcU_U1QU50NhqnmVlQqu89yR4m8l4ZiJM3bA&usqp=CAU",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,"
];

function listagem() {
  var imagesList = [];
  var seriesList = document.querySelector(".seriesList");

  for (var relacao = 0; relacao < listaSeries.length; relacao++) {
    imagesList.push("<img src=" + listaSeries[relacao] + ">");
  }

  seriesList.innerHTML = imagesList;
}

function adicionar() {
  var endereco = document.querySelector(".endereco").value;
  if (listaSeries.includes(endereco)) {
    return;
  }
  if (
    endereco !== "" &&
    (endereco.endsWith(".jpg") || endereco.endsWith(".png"))
  ) {
    listaSeries.push(endereco);
    listagem();
  }
}
listagem();

